#This approach is what initially came to my mind but time-complexity is big although it's better than the simple approach
class Solution(object):
    def isIsomorphic(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        a = False
        b = False
        if s==t:
            return True
        for i in xrange(0,len(s) -1):
            temp =s.replace(s[i],t[i])
            if temp == t:
                a = True
        for i in xrange(0,len(t) -1):
            temp =t.replace(t[i],s[i])
            if temp == s:
                b = True
        if a == True and b == True:
            return True

        return False
